import React, { useState } from "react";

function CounterScreen() {
    const [counter, setCounter] = useState(0);

    return (
        <div>
            <h1>Counter Screen</h1>
            <h2>Counter</h2>
            <button onClick={ () => setCounter(counter + 1)}
                ></button>

        </div>
    )
}

export default CounterScreen;
